import React from "react";
import DraggableUnderlineWrapper from "../../../assets/wrappers/BannerCreator/DraggableUnderlineWrapper";
import { BiUnderline } from "react-icons/bi";

const DraggableUnderline = () => {
  return (
    <DraggableUnderlineWrapper style={{ marginLeft: ".5rem" }}>
      <button>
        <BiUnderline />
      </button>
    </DraggableUnderlineWrapper>
  );
};

export default DraggableUnderline;
